import React from "react";
import menucocina from "../img/01-menu-cocina.svg";
import { Link } from "react-router-dom";

const Boton = () => {
  //return <h1>Aqui estoy, mirame</h1>;

  <Link to="/role">
    <img id="logo" src={menucocina} alt="" />
  </Link>;
};

export default Boton;
